     QScriptValue REcmaFlowLayout::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RFlowLayout* self = getSelf("RFlowLayout", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RFlowLayout* REcmaFlowLayout::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RFlowLayout* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RFlowLayout >(context->thisObject())
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RFlowLayout.%1(): "
                        "This object is not a RFlowLayout").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        REcmaShellFlowLayout* REcmaFlowLayout::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RFlowLayout* selfBase = getSelf(fName, context);
                REcmaShellFlowLayout* self = dynamic_cast<REcmaShellFlowLayout*>(selfBase);
                //return REcmaHelper::scriptValueTo<REcmaShellFlowLayout >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RFlowLayout.%1(): "
                    "This object is not a RFlowLayout").arg(fName),
                    context);
            }

            return self;
            


        }
